/**
 * Wiki Ecosystem Status Tool
 *
 * Returns current health status of the Not-Wikipedia ecosystem:
 * - Article count
 * - Broken links
 * - Orphan articles
 * - Category balance
 */

import { ToolModule } from "../types.js";
import * as fs from "fs";
import * as path from "path";

const WIKI_DIR = path.join(process.cwd(), "not-wikipedia");
const ECOSYSTEM_FILE = path.join(process.cwd(), "ecosystem.json");

interface EcosystemStatus {
  healthy: boolean;
  articles: number;
  brokenLinks: string[];
  orphanArticles: string[];
  placeholders: string[];
  categoryBalance: Record<string, number>;
  issues: string[];
}

function getEcosystemStatus(): EcosystemStatus {
  const status: EcosystemStatus = {
    healthy: true,
    articles: 0,
    brokenLinks: [],
    orphanArticles: [],
    placeholders: [],
    categoryBalance: {},
    issues: [],
  };

  try {
    // Get all HTML files
    const files = fs.readdirSync(WIKI_DIR).filter(f => f.endsWith(".html"));
    status.articles = files.length;

    // Build link graph
    const allLinks: Map<string, string[]> = new Map();
    const incomingLinks: Map<string, number> = new Map();

    files.forEach(f => incomingLinks.set(f, 0));

    for (const file of files) {
      const filePath = path.join(WIKI_DIR, file);
      const content = fs.readFileSync(filePath, "utf-8");

      // Find internal links
      const linkMatches = content.matchAll(/href="([^"]*\.html)"/g);
      const links: string[] = [];

      for (const match of linkMatches) {
        const link = match[1];
        links.push(link);

        // Check if link target exists
        if (!fs.existsSync(path.join(WIKI_DIR, link))) {
          status.brokenLinks.push(`${file} -> ${link}`);
        } else {
          // Count incoming links
          incomingLinks.set(link, (incomingLinks.get(link) || 0) + 1);
        }
      }

      allLinks.set(file, links);

      // Check for placeholders
      if (content.includes("NEXT_PAGE_PLACEHOLDER")) {
        status.placeholders.push(file);
      }
    }

    // Find orphan articles (no incoming links, except index)
    for (const [file, count] of incomingLinks) {
      if (file !== "index.html" && count === 0) {
        status.orphanArticles.push(file);
      }
    }

    // Load ecosystem.json for category data
    if (fs.existsSync(ECOSYSTEM_FILE)) {
      const ecosystem = JSON.parse(fs.readFileSync(ECOSYSTEM_FILE, "utf-8"));
      if (ecosystem.categories) {
        for (const [cat, data] of Object.entries(ecosystem.categories as Record<string, { article_count: number }>)) {
          status.categoryBalance[cat] = data.article_count;
        }
      }
    }

    // Compile issues
    if (status.brokenLinks.length > 0) {
      status.issues.push(`${status.brokenLinks.length} broken links`);
      status.healthy = false;
    }
    if (status.placeholders.length > 0) {
      status.issues.push(`${status.placeholders.length} unresolved placeholders`);
      status.healthy = false;
    }
    if (status.orphanArticles.length > 0) {
      status.issues.push(`${status.orphanArticles.length} orphan articles`);
    }

  } catch (error) {
    status.issues.push(`Error: ${error}`);
    status.healthy = false;
  }

  return status;
}

export const tool: ToolModule = {
  definition: {
    name: "wiki_ecosystem_status",
    description: "Get the current health status of the Not-Wikipedia ecosystem. Returns article count, broken links, orphan articles, placeholders, and category balance.",
    inputSchema: {
      type: "object",
      properties: {},
      required: [],
    },
  },

  handler: async () => {
    const status = getEcosystemStatus();
    return {
      content: [{
        type: "text",
        text: JSON.stringify(status, null, 2),
      }],
    };
  },
};

